import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import aBirdImage from '../../assets/images/webp/a-bird.webp'
import aGirlImage from '../../assets/images/webp/a-girl.webp'
import butterflyImage from '../../assets/images/webp/butterfly-image.webp'
import multipleColorImage from '../../assets/images/webp/multiple-color-image.webp'

const SwiperSlider = () => {
  return (
    <Swiper
      spaceBetween={50}
      slidesPerView={3}
    >
      <SwiperSlide><img src={aBirdImage} alt="bird" className='max-w-[437px]' /></SwiperSlide>
      <SwiperSlide><img src={aGirlImage} alt="bird" className='max-w-[437px' /></SwiperSlide>
      <SwiperSlide><img src={butterflyImage} alt="bird" className='max-w-[437px] h-[315px]' /></SwiperSlide>
      <SwiperSlide><img src={multipleColorImage} alt="bird" className='max-w-[437px' /></SwiperSlide>
    </Swiper>
  )
}

export default SwiperSlider
